import { Link } from 'react-router-dom';
import React from "react";
import "./MyPage.css"

function MyPage() {
    return(
        <div>
            <div className='container'>
            <img src={process.env.PUBLIC_URL + '/image.png'} />
            </div>
            <div className='container'>
            <button><Link className='editButton' to={'/edit-profile'}>수정하기</Link></button>
            <p>박범준</p>
            </div>

            <div className='container'>
            <Link className='mypage-navbar' to={'/mypage'}>홈</Link>
            </div>
        </div>
    );
}

export default MyPage;
